import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from "react-router-dom";

const Navbar = () => {
  
    const listItemStyle = {
      marginRight: '15px', // Adjust the value as needed
    };
  
    return (
      <>
        <div>
          <nav className="navbar navbar-expand-lg navbar-light " style={{ backgroundColor: "#e3f2fd" }}>
            <a className="navbar-brand" href="/">Cartify</a>
            <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarText" aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarText">
              <ul className="navbar-nav mr-auto">
                <li className="nav-item active" >
                  <Link className="hv" to="/" ><strong>Home</strong></Link>
                </li>
                <li className="nav-item" style={listItemStyle}>
                  <Link className="hv" to="/About"><strong>About</strong></Link>
                </li>
                <li className="nav-item" style={listItemStyle}>
                  <Link className="hv" to="/Contact"><strong>Contact</strong></Link>
                </li>
              </ul>
            </div>
          </nav>
        </div>
      </>
    );
  };
  
export default Navbar;
